import React from "react";
import Card from "@material-ui/core/Card";
import totalCardStyles from "styles/totalCard";
import { makeStyles } from "@material-ui/core/styles";

const useStyles = makeStyles(theme => totalCardStyles(theme));

const TotalCard = props => {
  const { cartItems } = props;
  const classes = useStyles();
  const itemsTotal = cartItems.map(item => {
    <li>
      {" "}
      {item.name} {item.currency} {item.price} * {item.quantity} = {item.price}{" "}
      *{item.quantity}
    </li>;
  });
  return <Card className={classes.totalCard}>{itemsTotal}</Card>;
};

export default TotalCard;
